    const [myData, setMyData] = React.useState([]);
    React.useEffect(()=>{
        setMyData(data.Data[0])
    },[data]);
    console.log(myData);
    return (
        <div>
            Home Page
            <h2>Coins</h2>
            {myData?.map(singleCoin=>{
                const {Id, ImageUrl, Name, Symbol, IsTrading} = singleCoin;
                return (
                    <div key={Id}>
                        <h2>{Name}</h2>
                    </div>
                )

            })}
        </div>
    )
}

export default Dashboard;
